import React from 'react';

function Nav(props) {
    return (
        <React.Fragment>
            <div className="component nav">
            <div className='nav-l-spacer'></div>
                <div>

                <b><span>___________</span></b>
                <b onClick ={()=>{props.toggleRegisterForm()}}>register<span>___________</span></b>
                {props.userLoggedIn && 
                <div>
                    <b onClick ={()=>{props.logoutUser()}}>logout<span>___________</span></b>

                </div>
                }
                { !props.userLoggedIn && 
                <div>
                    <b onClick ={()=>{props.toggleLoginForm()}}>login<span>___________</span></b>
                </div>
                }
                <b onClick ={()=>{props.toggleOrderForm()}}>order<span>___________</span></b>

                <b onClick ={()=>{props.toggleLogo()}}>info<span>___________</span></b>

                <b onClick ={()=>{props.toggleLogo()}}>menu<span>___________</span></b>
                </div>


            </div>
        </React.Fragment>
    );
}

export default Nav;
